{"3": ["То что ждал", "2021-03-06T09:14:38Z", "серый", "0", 0, 1, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "4": ["Не берите! Во-первых протекает; во-вторых невозможно ее открыть, тугая до ужаса! ", "2021-03-01T07:46:19Z", "серый", "0", 2, 1, 1, "Форма круглая разъемная 18х7 см", "Regent inox"], "5": ["По качеству товар отличный, в деле ещё не проверяла. Материал достаточно плотный, думаю, что все будет нормально. ", "2021-02-21T16:46:57Z", "серый", "0", 1, 1, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "6": ["Хорошая форма! Не пригорают изделия, размер оптимальный. Брала для чизкейков. Довольна", "2021-02-11T19:44:01Z", "серый", "0", 3, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "11": ["Тавар не понравился маленький слишком", "2021-02-07T16:02:59Z", "серый", "0", 2, 7, 1, "Форма круглая разъемная 18х7 см", "Regent inox"], "12": ["Забирал муж. \nПринес вместо 18 см 24.... форма может и ничего, но как же плохо стала работать служба по комплектации заказов", "2021-02-07T14:04:16Z", "серый", "0", 0, 1, 3, "Форма круглая разъемная 18х7 см", "Regent inox"], "13": ["Хорошая форма, без дефектов. Пришла в обычном пакете, сверху пупырка.", "2021-02-01T17:38:30Z", "серый", "0", 0, 1, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "14": ["Ужасный товар!!!! Залив тесто туда( для шарлотки) начало вытекать сразу из всех щелей. Думал,что закрыл не так. Помыл от теста и налил туда для проверки воды. Вода потекла как в сито. Не думал,что так разочаруюсь,казалось бы в таком ходовом товаре.  Так что друзья !!!!! Не берите данный товар. Не рекомендую-это мало сказать. Обходите данный товар стороной.", "2021-01-29T15:32:15Z", "серый", "0", 6, 5, 1, "Форма круглая разъемная 18х7 см", "Regent inox"], "15": ["Отличная форма, размер идеальный для небольших высоких тортов.", "2021-01-26T10:16:59Z", "серый", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "17": ["Хорошая форма. Для пирогов идеальная, главное не шоркать по ней железными лопатка и ножами - поверхность антипригарная, но рацапается. Для жидкого теста подкладываю на всякий случай пергамент на дно, чтобы не протекало.", "2021-01-20T10:22:03Z", "серый", "0", 2, 0, 4, "Форма круглая разъемная 18х7 см", "Regent inox"], "18": ["Отличная форма. Дно выстилаю бумагой, зажимаю боками, ничего не вытекает. Пеку регулярно. Довольна. Купила вторую, чтобы сразу печь два бисквита одновременно, убирается на решетку сразу две формы. Класс!", "2021-01-02T20:07:27Z", "серый", "0", 6, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "19": ["Пользуюсь, но ставить приходится на противень, вытекает жидкость из бисквитов. По размеру как раз небольшой тортик на семью пеку", "2020-12-21T07:27:57Z", "серый", "0", 1, 0, 4, "Форма круглая разъемная 18х7 см", "Regent inox"], "20": ["Замечательная форма, то, что было нужно. Премыкание к дну действительно не очень плотное, но все решилось пекарской бумагой", "2020-12-17T18:57:35Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "21": ["Отличная форма ! ", "2020-12-13T16:54:10Z", "серый", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "22": ["форма неплохая единственное показалось не очень плотное примыкание на днетак как при выпечке вытекло немного тесто", "2020-11-21T15:14:26Z", "серый", "0", 2, 0, 4, "Форма круглая разъемная 18х7 см", "Regent inox"], "23": ["Пришла с браком, половина теста вытекло в духовку.", "2020-11-19T11:39:25Z", "серый", "0", 2, 3, 1, "Форма круглая разъемная 18х7 см", "Regent inox"], "24": ["Форма мне понравилась", "2020-11-14T07:08:04Z", "серый", "0", 0, 5, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "25": ["Отличная форма. Бисквит очень хорошо пропекаеться,нечего невытекает.\nПришол без каких-либо дефектов!", "2020-11-02T09:37:17Z", "серый", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "27": ["Форма удобная, не заедает. \nПришлось использовать, не обертывая края бумагой- сразу же стёрлось покрытие на стыке. Но вроде не критично", "2020-10-29T11:52:19Z", "серый", "0", 0, 1, 4, "Форма круглая разъемная 18х7 см", "Regent inox"], "28": ["Отличная форма! Для чизкейков идеальна", "2020-10-29T03:49:03Z", "серый", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "29": ["Два раза испекла шарлотку, форма очень нравилась. Объем на двоих идеальный, тесто не протекало. После третьего применения облезло покрытие", "2020-10-22T11:23:59Z", "серый", "0", 3, 1, 2, "Форма круглая разъемная 18х7 см", "Regent inox"], "30": ["Внешне форма соответствует всем заявленным параметрам,  забрала только сегодня, еще не использовала.  Внешне устраивает всё -  размер, толщина стенок, нет изъянов и дефектов. Отзыв бы следовало написать  после  первой выпечки, но у меня на совести  ДИЗЛАЙК в отношении отзыва (с  фото прекрасной выпечки) покупательницы Ольги от  05 Октября, 18:45, мои извинения,  случайно.....", "2020-10-22T10:56:27Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "34": ["Очень хорошая форма, специально брала для чизкейка, масло немного вытекает но это нормально, простилаю пергаментом и делаю бортик из фольги, потом все идеально вынимается, однозначно рекомендую закажу ещё другой диаметр  ", "2020-10-05T15:45:28Z", "серый", "0", 16, 2, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "35": ["Супер, отлично работает\nОчень удобная вещь для выпечки коржей\nВышел прекрасный бисквит для торта", "2020-10-05T08:13:44Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "37": ["Форма пришла целая, хорошо держала дно. Моему счастью не было предела. Испекла в ней чизкейк - все замечательно. Сейчас решила печь бисквит, форма не сходится до конца, там щель размером в почти 0,5 см. Безумно расстроена. По сути ее износ - 1 блюдо. Обидно! Тесто теперь выливается с боков, дно проваливается, крепления ослабли. ", "2020-10-02T15:25:22Z", "серый", "0", 2, 0, 1, "Форма круглая разъемная 18х7 см", "Regent inox"], "40": ["Очень довольна формой! Мегаудобно делать чизкейк, да и любую выпечку без труда достанешь. Размер отличный!", "2020-09-30T02:51:02Z", "серый", "0", 10, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "42": ["Хорошая форма. Была упакована в пакет. Пришла без повреждений.", "2020-09-28T13:21:14Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "43": ["Форма неплоха, за свои деньги- отличная. Уже опробовала, тесто не пристает. ", "2020-09-28T13:09:47Z", "серый", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "44": ["Форма пришла целая,не помятая. Товаром довольна.", "2020-09-28T13:02:51Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "47": ["Забрали сегодня и сразу испекли чизкейк. Форма понравилась. Ничего не пригорело. Отлично пропеклось. Размер небольшой, такой и нужен был. Спасибо!", "2020-09-27T11:50:52Z", "серый", "0", 5, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "48": ["Прочитала отзывы , боялась что придёт мятая, но видимо мне повезло. Форма пришла в отличном состоянии, открывается и закрывается хорошо. Я осталась довольна. ", "2020-09-27T07:44:34Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "49": ["Жидкое тесто не протекает, чему очень рада. Форма целая, не деформирована.", "2020-09-25T12:36:34Z", "серый", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "50": ["Форма пришла деформированная. Жаль.", "2020-09-25T11:57:01Z", "серый", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "52": ["Пришла форма круглая, не деформированная, но упаковка... Пакет, даже не запаянный, и пупырка. Ни коробки, ни нормальной упаковки...", "2020-09-23T06:08:05Z", "серый", "0", 0, 1, 3, "Форма круглая разъемная 18х7 см", "Regent inox"], "54": ["Качество хорошее, размер, что надо. Рекомендую！", "2020-09-21T15:50:47Z", "серый", "0", 3, 2, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "55": ["Форма чудесная,никаких нареканий к ней нет", "2020-09-20T17:00:13Z", "серый", "0", 13, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "57": ["ХОРОШАЯ  ФОРМА !  ТЕСТО  НЕ ВЫТЕКЛО  !РАЗМЕР   УСТРОИЛ  БОЛЕЕ  ЧЕМ !", "2020-09-17T02:14:50Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "61": ["Хорошая форма, пекла 5 коржей на торт, слегка прилипает тесто, но отлипает легко при помощи лопатки. Мыла губкой.", "2020-07-10T04:39:31.903673698Z", "серый", "0", 8, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "64": ["Супер готовлю чизкейки идеально ) размер шикарный рекомендую всем !!! ", "2020-08-23T22:27:55Z", "серый", "0", 9, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "68": ["Хорошая форма, размер соответствует описанию ", "2020-08-16T06:50:29Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "70": ["Формочка пришла ровненькая, размер в самый раз, как и хотела", "2019-02-22T12:25:07.924796754Z", "черный", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "72": ["Обалденная форма. По началу думала, что не удобно будет снимать форму. Но все вышло отлично. Форма пришла без вмятин, все было хорошо упаковано.", "2020-08-13T01:36:33Z", "серый", "0", 5, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "74": ["Форма хорошая, пришла без брака", "2020-08-01T08:41:29.787798339Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "78": ["Очень понравилось. Сначала показалась маловатой (не посмотрела на размер при заказе). А потом поняла- в самый раз. На тортик на 4-5 человек. Не пригарает, не подтекает даже когда делала в форме желе и выливала житкость с желатином.", "2020-08-06T17:34:15Z", "серый", "0", 0, 2, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "79": ["Форма вся кривая ! ", "2020-08-06T15:18:02Z", "серый", "0", 0, 1, 1, "Форма круглая разъемная 18х7 см", "Regent inox"], "81": ["Пришла мятая, но за 240 рублей пойдет, в деле не пробовала ещё.", "2020-08-04T15:02:43.020664466Z", "серый", "0", 2, 0, 2, "Форма круглая разъемная 18х7 см", "Regent inox"], "82": ["Очень хорошая форма, добротная, не тонкая, качественная ! Удивляют отзывы о протекании ! В такие форма всегда прокладывается пергамент! Она не герметична! Так с любой разъемной формой!!!! Форма супер! Размер идеален! ", "2020-08-02T10:55:15.446124299Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "83": ["А мне досталась \"кривая\", отказалась, заказала снова, форма хорошая.", "2020-08-02T10:46:54.718038309Z", "серый", "0", 1, 0, 3, "Форма круглая разъемная 18х7 см", "Regent inox"], "84": ["Отличная форма. Удобно готовить чизкейк. Особенно на двоих", "2020-07-29T05:51:38.473782804Z", "серый", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "85": ["Товар пришел с браком, забирать не стала, деньги не вернули", "2020-07-17T23:03:41.815489889Z", "серый", "0", 1, 1, 1, "Форма круглая разъемная 18х7 см", "Regent inox"], "86": ["Форма отличная. Мне пришла в хорошем состоянии. Выпечка в ней получается отличная, ничего не вытекает ", "2020-07-12T05:58:25.146066883Z", "серый", "0", 2, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "87": ["Форма неплохая, однако пришла с дефектами: плохо открывается, есть вмятины в стыках. Выпекать ещё ничего не пробовала.", "2020-07-10T04:58:10.060237772Z", "серый", "0", 1, 0, 2, "Форма круглая разъемная 18х7 см", "Regent inox"], "89": ["Форма деформированная и протекает", "2020-07-06T09:07:38.886084206Z", "серый", "0", 1, 0, 2, "Форма круглая разъемная 18х7 см", "Regent inox"], "91": ["Получила формочку, состояние идеальное. Насчёт подтеков, то хочу сказать некоторым, что всегда кладётся пергамент на дно. А косяк доставки, которая испортила форму, фирма тут ни при чем. Так что пишите жалобы насчёт доставки в поддержку.", "2020-07-05T12:39:16.189866625Z", "серый", "0", 7, 3, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "92": ["Форма отличная! Тесто для бисквита не вытекло. Из формы пирог буквально выскользнул, очень легко вынимается.  Давно искала именно такого диаметра, все идиально подошло.", "2020-07-05T06:14:07.865635804Z", "серый", "0", 2, 1, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "93": ["Форма классная, не течёт , делала в ней чизкейк. Все получилось. Но, в фикспрайсе такие по 150 рублей..", "2020-07-04T06:41:00.434952659Z", "серый", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "95": ["А мне пришла форма с круглым дном и овальными деформированными бортами! Отказ!!!👎", "2020-07-02T07:54:31.877235485Z", "серый", "0", 1, 0, 3, "Форма круглая разъемная 18х7 см", "Regent inox"], "97": ["Прекрасная форма. Не могу отметить недостатков👍🏻", "2020-06-30T05:39:08.05816924Z", "серый", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "98": ["По качеству норм", "2020-06-29T06:57:06.037163068Z", "серый", "0", 3, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "99": ["Форма просто замечательная! Доехала отлично: не мятая, не коцаная. Пока пробовала в ней готовить только шарлотку и картофельный киш. \"Шарлоточное\" тесто подвытекло немного в одном месте, буквально несколько капель, но ничего. Возможно, в одном месте не слишком плотно дно прилегает, надо попробовать повертеть. А так не критично - можно обернуть низ формы плотной фольгой. В общем, я довольна, как слон:) Считаю, удачная покупка!", "2020-06-29T06:30:32.110429128Z", "серый", "0", 6, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "100": ["Пока все отлично, механизм работает без нареканий. Дополню отзыв когда опробую в деле.", "2020-06-27T09:46:56.049464527Z", "серый", "0", 2, 1, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "101": ["Очень ждала эту форму. Пришла деформорованная (( печаль. Возврат. Теперь думаю заказывать ли повторно🤔. Жду возврат средств. Прошу не учитывать сумму выкупа", "2020-06-25T10:14:31.439882054Z", "серый", "0", 1, 1, 2, "Форма круглая разъемная 18х7 см", "Regent inox"], "103": ["Впервые заказала и опять очень недовольна товаром. Упаковка распечатана, внутренняя часть болтается.  Почему товар с браком гуляет по всей стране? Пришлось купить, буду прокладывать бумагу , если это поможет.\r\nВ прошлый заказ привезли туфли в распечатанной коробке - разной модели и даже разного цвета. \r\nСегодня заказала плед и есть один отзыв с фото - дыра в 10 см. Попрошу не присылать мне этот плед с браком.", "2020-06-23T18:08:48.747260203Z", "серый", "0", 1, 0, 3, "Форма круглая разъемная 18х7 см", "Regent inox"], "105": ["Заказывала два раза. Первая форма пришла в закрытой упаковке, претензий к качеству не было. Вторая форма пришла в распечатанной упаковке, неправильно закрыта на защелку и с браком: дно гнутое, не прилегает плотно, \"гуляет\". На фото это не видно. Явно, что эта форма уже была в отказе.", "2020-06-22T19:01:40.544625968Z", "серый", "0", 1, 0, 4, "Форма круглая разъемная 18х7 см", "Regent inox"], "107": ["Отличная форма! Готовила и запеканку и тарт. Размер для меня идеальный.", "2020-06-22T07:20:28.435206264Z", "серый", "0", 0, 1, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "108": ["Получила заказ и очень довольна! Несмотря на малюсенький недочёт, за такую цену - это сущие пустяки. Формочка и правда небольшая, но я именно такую и искала: не очень то хочется готовить тортик на двоих в огромной таре.Спасибо ВБ и производителю!)", "2020-06-21T12:54:42.690487183Z", "серый", "0", 5, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "110": ["Форма оказалась бракованной,вытекает, жидкий чизкейк протечет, подойдёт только для  густой жидкости, если есть возможность необходимо проверять форму на месте сразу заливая туда воду.", "2020-06-20T22:26:23.09264544Z", "серый", "0", 0, 1, 2, "Форма круглая разъемная 18х7 см", "Regent inox"], "114": ["Вот что,не почитала отзывы😞жидкое тесто вытекло,очень огорчена,на вид ровная без дефектов", "2020-06-18T17:45:01.662525654Z", "серый", "0", 1, 0, 4, "Форма круглая разъемная 18х7 см", "Regent inox"], "115": ["Форма на п