Пришла гнутая... выпрямлять - не вариант, может \"поехать\" покрытие... буду перезаказывать", "2017-06-07T17:54:22+03:00", "черный", "0", 1, 0, 3, "Форма круглая разъемная 18х7 см", "Regent inox"], "407": ["Отличная форма. Кажется вроде как небольшой диаметр, но торт получается самый что надо размер. Качество понравилось, уже не раз пекла. Подружке посоветовала, тоже купила, довольны все. Кстати, на удивление, здесь цена дешевле чем в других магазинах", "2017-03-16T18:51:39+03:00", "черный", "0", 1, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "408": ["То что искала, маленькая но вместительная формочка. Пишут гнутая приходит, и что? Мне тоже пришла слегка согнутая, ничего в этом страшного, она гибкая, согнула на место, она не в жесткой упаковке, вполне может немного согнуться при транспортировке, но по мне это не брак и меня все устраивает))) спасибо любимому магазину)))", "2017-03-07T20:19:00+03:00", "черный", "0", 12, 3, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "409": ["хорошее качество,отказ из-за несоответсвия размера", "2017-02-20T18:41:23+03:00", "черный", "0", 0, 2, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "410": ["Форма хорошая. У меня есть другие диаметры этой фирмы, нравятся. Давно присматривала форму небольшого диаметра, очень была рада, что нашла. Заказала. Ждала с нетерпением!!! Получала в пункте самовывоза на Профсоюзной. Товар оказался бракованный - форма была сильно гнутой (овал), сотрудник пункта сам-за отметила брак. После проверки пришло письмо от WB, что брак не подтверждён!!!! Противно, когда такой очевидный брак не подтверждают. Вы уж, уважаемые, тогда храните и транспортируйте товар более аккуратно, чтобы не огорчать своих клиентов! Одна звезда только за ситуацию.", "2017-02-09T18:28:22+03:00", "черный", "0", 5, 1, 1, "Форма круглая разъемная 18х7 см", "Regent inox"], "412": ["Форма хорошая.Как и заявлено в описании-18 см. Жёсткая,форму держит. Пришла упакованная в полиэтилен и пузырчатую плёнку.", "2017-0