ю", "2016-01-29T19:29:09+03:00", "черный", "0", 2, 0, 1, "Форма круглая разъемная 18х7 см", "Regent inox"], "431": ["3 из за того что тесто слегка вытекает из формы. А так вполне нормальная.", "2016-01-25T15:52:11+03:00", "черный", "0", 2, 0, 3, "Форма круглая разъемная 18х7 см", "Regent inox"], "432": ["Отличная форма! Сначала замок был тугой, но за пару раз разработался. Тесто не течет, но я на дно кладу бумагу для выпекания и прям с ней защелкиваю. Пекла и бисквит, и птичье молоко заливала, все ок.", "2016-01-13T13:47:25+03:00", "черный", "0", 5, 0, 5, "Форма круглая разъемная 18х7 см", "Regent inox"], "433": ["Совсем неплохо,d 18 см,купила вместо формовочного кольца для салатов,но и для выпечки мелких тортиков вполне сойдёт,качество хорошее,материал плотный,но для жидкого теста не пойдёт,ибо протекает", "2015-12-30T21:45:21+03:00", "черный", "0", 11, 0, 4, "Форма круглая разъемная 18х7 см", "Regent inox"], "434": ["Диаметр формы 18 см,а не 12,как написано описании.Качество среднее,металл мягкий,легко гнется,у меня не течёт,но прилипает,даже если форму смазать маслом.Моя оценка,увы,3.", "2015-11-16T14:39:01+03:00", "черный", "0", 14, 0, 3, "Форма круглая разъемная 18х7 см", "Regent inox"], "435": ["Форма течет", "2015-11-13T19:37:47+03:00", "черный", "0", 13, 2, 1, "Форма круглая разъемная 18х7 см", "Regent inox"], "436": ["Ужасней формы у меня еще не было! Тесто вытекает через щели в дне...ужас просто!", "2015-11-10T20:19:52+03:00", "черный", "0", 19, 1, 1, "Форма круглая разъемная 18х7 см", "Regent inox"]}
